import React, { useState, useEffect } from 'react';
import './Review.css';

function Review({ fileName, fileType, detectedPii, onProceed, onCancel }) {
  const [reviewItems, setReviewItems] = useState([]);

  useEffect(() => {
    if (detectedPii) {
      setReviewItems(
        detectedPii.map((item, index) => {
          const rawConfidence = item.confidence !== undefined ? item.confidence : item.avgConfidence;
          const displayConfidence = Math.round(rawConfidence * 100);

          return {
            // This is crucial: if item already has an ID (e.g., from backend if Jason adds it), use it.
            // Otherwise, generate a unique one for React's internal key management.
            id: item.id || `${item.detect}-${item.start || item.column}-${index}`,
            ...item,
            confidence: displayConfidence,
            avgConfidence: displayConfidence,
            ignore: displayConfidence < 70 ? true : (item.ignore || false)
          };
        })
      );
    }
  }, [detectedPii]);

  const handleIgnoreChange = (id) => {
    setReviewItems(prevItems =>
      prevItems.map(item =>
        item.id === id ? { ...item, ignore: !item.ignore } : item
      )
    );
  };

  const renderTableContent = () => {
    if (fileType === 'Text file' || fileType === 'Image file' || fileType === 'Document file') { // Group similar types
      return (
        <>
          <thead>
            <tr>
              <th>Word</th>
              <th>Entity</th> {/* Changed from PII_Confidence_Title to Entity for clarity */}
              <th>PII_Confidence</th>
              <th>Ignore</th>
            </tr>
          </thead>
          <tbody>
            {reviewItems.map(item => (
              <tr key={item.id}>
                <td>{item.word}</td>
                <td>{item.detect}</td> {/* Use item.detect from backend */}
                <td className={item.confidence < 70 ? 'confidence-low' : 'confidence-high'}>
                  {item.confidence}%
                </td>
                <td>
                  <input
                    type="checkbox"
                    checked={item.ignore}
                    onChange={() => handleIgnoreChange(item.id)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </>
      );
    } else if (fileType === 'Tabular file') {
      return (
        <>
          <thead>
            <tr>
              <th>Column</th>
              <th>Entity</th> {/* Changed from PII_Confidence_Title to Entity for clarity */}
              <th>Top data (First 2 rows)</th>
              <th>PII_Confidence (Avg)</th>
              <th>Ignore</th>
            </tr>
          </thead>
          <tbody>
            {reviewItems.map(item => (
              <tr key={item.id}>
                <td>{item.column}</td>
                <td>{item.detect}</td> {/* Use item.detect from backend */}
                <td>
                  {Array.isArray(item.topData) ? item.topData.join(', ') : item.topData}
                </td>
                <td className={item.avgConfidence < 70 ? 'confidence-low' : 'confidence-high'}>
                  {item.avgConfidence}%
                </td>
                <td>
                  <input
                    type="checkbox"
                    checked={item.ignore}
                    onChange={() => handleIgnoreChange(item.id)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </>
      );
    }
    return null; // Or handle other file types
  };

  return (
    <div className="modal-overlay">
      <div className="review-modal-content">
        <div className="modal-header">
          <h2>Review Before Anonymization</h2>
          <button className="close-button" onClick={onCancel}>&times;</button>
        </div>
        <div className="review-modal-body">
          <p>File: <strong>{fileName}</strong> (Type: {fileType})</p>
          <div className="review-table-container">
            {reviewItems.length > 0 ? (
              <table>
                {renderTableContent()}
              </table>
            ) : (
              <p className="no-pii-message">No PII detected for this file, or data not available for review.</p>
            )}
          </div>
          <p className="note-text">Note: Those below 70% automatically marked as ignore (NONE_PII).</p>
        </div>
        <div className="modal-footer">
          <button className="proceed-button" onClick={() => onProceed(reviewItems)}>Proceed</button>
        </div>
      </div>
    </div>
  );
}

export default Review;
